2. Lento moderato – Moderato maestoso – the slow movement opens with an F-major [[natural horn|natural-horn]] solo above an F-minor chord, a [[Theme (music)|theme]] that is developed by a solo [[cello]].{{Citation needed|date=September 2015}}<!--The cited melody doesn't sound remotely like being in F major. Who says this is its key?--><br> <score vorbis="1"> { 
ew PianoStaff << 
ew Staff elative c' { \clef treble 	ime 3/4 	empo "Lento moderato" 4 = 70 R2. 	imes 2/3 {c8\p( d a' } g4. e8 | d c d e g4~ | g8 e g4. e8) } 
ew Staff elative c' { \clef bass 	ime 3/4 <aes f c f,>2.~\pp <aes f c f,>2.~ | <aes f c f,>2 <aes f c f,>4~ | <aes f c f,>2. } >> } </score>  Just as in the first movement, the ideas flow gently from one to the next, ultimately leading to the trumpet cadenza. Here, the instrument is in effect a [[natural trumpet]] (a trumpet without valves) in E{{flat}}, since the player is instructed not to use the valves. As a result, the [[seventh harmonic]] is played instead of the ordinary [[minor seventh]], and so it sounds slightly out-of-tune in [[12-tone equal temperament]].<!--Out of tune with what? The natural seventh is perfectly in tune with its fundamental, as well as with the third, fifth, and even the upper octave, in the ratio of 8:7.--><br> <score vorbis="1"> 
ew Staff \with { emove "Time_signature_engraver" } elative c'' { \clef treble \cadenzaOn ees4. ees,8-- bes'--[ ees--] des4~( 	imes 2/3 { des8[ bes ees] } 	imes 2/3 { des[ bes ees] } des4) } </score> The entire cadenza is played over a [[Pedal point|pedal note]] in the strings.{{or-inline|date=September 2015}}<!--Howells's Ex. 8 contradicts this claim, but this requires interpretation of the example, since the accompaniment is not described.--> The cadenza material later reappears on the natural horn in F, gently accompanied by a returning theme now played on the [[cor anglais]].<ref>Howells, p.&nbsp;128.</ref> The movement ends with a quiet chord in the [[violin]]s' high register.{{or-inline|date=September 2015}}
